import React, {Component} from "react";
import styles from "../Home.module.css"
import logo from "../../../../images/new_лого.png";

// import {
//     Link, BrowserRouter,
// } from 'react-router-dom';

export default class Header extends Component {

    render() {
        return (
            // <BrowserRouter>
                <header>
                    <img src={logo} alt={"logotype"}/>

                <nav className={styles.navigation}>
                    <li href="https://ionic.io/ionicons">Home</li>
                    <li href="#">About</li>
                    <li href="#">Services</li>
                    <li href="#">Feedback</li>
                    <button className={styles.LoginPopup}>Login</button>
                </nav>
            </header>
                // <Link to="/Main"><li>to Main</li></Link>
            // </BrowserRouter>
        );
    }
}
